import { Box, Button, Modal, Stack, TextField, Typography } from '@mui/material';
import * as React from 'react';



function  User_DeleteModal(): React.ReactElement {
  const [open, setOpen] = React.useState(false);
  const handleOpen = () => {
    setOpen(true);
  };
  const handleClose = () => {
    setOpen(false);
  };

  return (
    <div>
      <Button variant="contained"  
              size="small" 
              sx={{ width: 110, 
                color:'#ffff', 
                backgroundColor: '#000000', 
                borderColor:'#434343'
                }}
              onClick={handleOpen}
      >
        탈 퇴
      </Button>
      <Modal
        open={open}
        onClose={handleClose}
        aria-labelledby="parent-modal-title"
        aria-describedby="parent-modal-description"
      >
          <Box sx={{ display: 'flex',
                     position:'relative', 
                     width:400, 
                     height:400, 
                     margin:'auto', 
                     textAlign:'center', 
                     border: 1, 
                     borderRadius: 5, 
                     backgroundColor:'#ffffff', 
                     flexDirection: 'column', 
                     mt:5 
                  }}
          >
          <Box sx={{ mt:10, mb:15 }} >
              <Typography sx={{ fontSize: 20, fontWeight:'bold', mb:5}}>
                회원 탈퇴를 하시려면 비밀번호를 입력하세요.
              </Typography>
              <TextField label="비밀번호 입력" sx={{ mt:2, width:300, height:10}} />
          </Box>
          <hr className='underline'/>
          <Stack direction="row" 
                  spacing={2} 
                  sx={{ margin:'auto' }} 
          >
              <Button variant="contained"  
                      size="small" 
                      sx={{ color:'#ffff', 
                            backgroundColor: '#26a69a',
                      }}
                      onClick = { handleClose }>
                  탈 퇴
              </Button> 
              <Button variant="contained"  
                      size="small" 
                      sx={{ color:'#ffff', 
                            backgroundColor: '#26a69a',
                      }}
                      onClick = { handleClose }>
                  취 소
              </Button> 
          </Stack>
        </Box>
      </Modal>
    </div>
  );
}

export default User_DeleteModal;
